webpackJsonp([0xcf856b418cd3],{8291:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"New Phone",date:"21 Apr 2006",slug:"/2006-04-21-new-phone/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/132417698/" title="photo sharing"><img src="http://static.flickr.com/52/132417698_55214d6ec4_m.jpg" alt="" /></a></p>\n<p><a href="http://www.flickr.com/photos/papascott/132404535/" title="Photo Sharing"><img src="http://static.flickr.com/46/132404535_1894fd7fb4_m.jpg" width="180" height="240" alt="test" /></a></p>\n<p>Don\'t mind me, I\'m just trying out the new cameraphone.</p>'},next:{fields:{title:"Nothing Healthy on the Dollar Menu",date:"20 Apr 2006",slug:"/2006-04-20-nothing-healthy-on-the-dollar-menu/"}},previous:{fields:{title:"Google's China Problem",date:"22 Apr 2006",slug:"/2006-04-22-googles-china-problem/"}}},{node:{fields:{title:"Nothing Healthy on the Dollar Menu",date:"20 Apr 2006",slug:"/2006-04-20-nothing-healthy-on-the-dollar-menu/",tags:"Y2006"},html:'<p><a href="http://www.kottke.org/remainder/06/04/10860.html" title="Because of their Dollar Menu...  (kottke.org)">Kottke</a> says: <a href="http://www.nytimes.com/2006/04/19/business/19mcdonalds.html?ex=1303099200&amp;en=8a22aac6da62b548&amp;ei=5090&amp;partner=rssuserland&amp;emc=rss">"Because of their Dollar Menu (which doesn\'t feature any of their recently added healthy menu items), sales at McDonald\'s have risen sharply over the last three years.</a> In Germany you can get a side salad on the <a href="http://www.mcdonalds.de/html/products/1x1_2/start.html">"1x1 Menu"</a>. Do the American Dollar Menu ads really target young low-income ethnics?</p>'},next:{fields:{title:"Math Teacher Arrested",date:"20 Apr 2006",slug:"/2006-04-20-math-teacher-arrested/"}},previous:{fields:{title:"New Phone",date:"21 Apr 2006",slug:"/2006-04-21-new-phone/"}}},{node:{fields:{title:"Math Teacher Arrested",date:"20 Apr 2006",slug:"/2006-04-20-math-teacher-arrested/",tags:"Y2006"},html:"<p>Another victory in the war on terror: <a href=\"http://info.interactivist.net/article.pl?sid=06/04/18/1633231\" title=\"Interactivist Info Exchange | US Detains Al-Gebra Operative\">US Detains Al-Gebra Operative</a> (as seen at <a href=\"http://www.spreeblick.com/2006/04/20/mathe-lehrer-festgenommen/\">Spreeblick</a>).</p>\n<blockquote><p>At New York's Kennedy airport today, an individual later discovered to be a public school teacher was arrested trying to board a flight while in possession of a ruler, a protractor, a setsquare, a slide rule, and a calculator.</p>\n<p>At a morning press conference, US Attorney General Alberto Gonzales said he believes the man is a member of the notorious al-gebra movement. He is being charged by the FBI with carrying weapons of math's instruction.</p>\n<p>&ldquo;Al-gebra is a fearsome cult,&rdquo; Gonzales said. &ldquo;They desire average solutions by means and extremes, and sometimes go off on tangents in a search of absolute value. They use secret code names like 'x' and 'y' and refer to themselves as 'unknowns', but we have determined they belong to a common denominator of the axis of medieval with coordinates in every country. As the Greek philanderer Isosceles used to say, 'there are 3 sides to every triangle'.&rdquo;</p>\n</blockquote>"},next:{fields:{title:"Job Description",date:"20 Apr 2006",slug:"/2006-04-20-job-description/"}},previous:{fields:{title:"Nothing Healthy on the Dollar Menu",date:"20 Apr 2006",slug:"/2006-04-20-nothing-healthy-on-the-dollar-menu/"}}}],pathPrefix:"",first:!1,last:!1,index:226,pageCount:1101}}}});
